import { KeysProfile } from '../types';

export const KEYS: KeysProfile = {
  CHERRY_MX: {
    PATH: 'assets/keys/cherry-mx/',
    SIZES: [
      { key: '1', value: 18 - 5 },
      { key: '1.25', value: 23 - 6 },
      { key: '1.5', value: 28 - 6 },
      { key: '1.75', value: 32 - 6 },
      { key: '2', value: 37 - 6 },
      { key: '2.25', value: 42 - 6 },
      { key: '2.5', value: 47 - 6 },
      { key: '2.75', value: 51 - 6 },
      { key: '6.25', value: 118 - 5 },
